import React from 'react';
import './SearchBox.css';

const SearchBox = ({ onSearch }) => {
    return (
        <input 
            type="text"
            className="search-box"
            placeholder="Search drivers..."
            onChange={(e) => onSearch(e.target.value)}
        />
    );
};

export default SearchBox;
